    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from May through July of
    1940. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, predators, reptiles, and disease- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    wildfires. The public relations section of the report describes recreational uses,
    Refuge visitors, and fishing. Photographs are attached. A short narrative report
    of North Platte National Wildlife Refuge is included.",nt"license_title": "License
